import React, { useState } from "react";
import { calcularCotacao } from "../services/api";

const Cotacao = () => {
    const [origem, setOrigem] = useState("Goiânia-GO");
    const [destino, setDestino] = useState("");
    const [peso, setPeso] = useState("");
    const [resultado, setResultado] = useState(null);

    const handleCalcular = async () => {
        const dados = { origem, destino, peso: parseFloat(peso) };
        const resultadoCotacao = await calcularCotacao(dados);
        setResultado(resultadoCotacao);
    };

    return (
        <div className="container">
            <h2>Cotação de Frete</h2>
            <div className="form-group">
                <label>Origem:</label>
                <input type="text" value={origem} disabled />
            </div>

            <div className="form-group">
                <label>Destino:</label>
                <input
                    type="text"
                    value={destino}
                    onChange={(e) => setDestino(e.target.value)}
                />
            </div>

            <div className="form-group">
                <label>Peso (kg):</label>
                <input
                    type="number"
                    value={peso}
                    onChange={(e) => setPeso(e.target.value)}
                />
            </div>

            <button className="btn-primary" onClick={handleCalcular}>
                Calcular
            </button>

            {resultado && (
                <div className="resultado">
                    <h3>Resultado:</h3>
                    <p>Preço do Frete: R$ {resultado.preco}</p>
                </div>
            )}
        </div>
    );
};

export default Cotacao;
